Well here it is, the collar bone delete kit. It’s been one hell of a ride this year and I wanted to end the last bit of the season and the last year of my 20s with a proper send off! My gut was telling me this wasn’t a good idea but I wanted it so bad I pushed through. I had heard a few comments about the speed and the reshaped landing that I think it got in my head. For me casing wasn’t an option and I unfortunately over shot the landing a bit and was slightly off body position to be able to withstand the massive impact of a feature this large. This is the stuff they don’t teach ya in the @pinkbikeacademy 😂! At least this is at the end of the bike season so I won’t try to rush back and take my time with a full recovery. Moving forward in 2023 I will be focusing more on my bike handling and technical riding rather then just amplitude, even tho I love it! 
Thanks to everyone that’s reached out, your messages are greatly appreciated!😊 Surgery went well and I am in good spirits!
